<div id="header">
<h1 class="title">Recursos de las escuelas</h1>
<h4 class="date"><em>08/06/2015</em></h4>
</div>


<p>Uno de los objetivos principales del CEMABE es conocer la infraestructura, el equipamiento y los servicios de los centros de trabajo educativos. Por ello el Cuestionario de Inmueblei indagó las características constructivas de la escuela, los servicios básicos disponibles, la infraestructura educativa y sanitaria, así como las condiciones de la misma; las medidas de protección civil implementadas y los recursos para emergencias disponible.</p>
<p>El Cuestionario de Inmueble recopiló diversa información que se puede resumir en el listado siguiente:</p>
<ul>
<li>Datos de identificación del inmueble y del informante</li>
<li>Tipo de inmueble y dirección</li>
<li>Centros de trabajo y sus características generales</li>
<li>Características de la construcción del inmueble</li>
<li>Servicios básicos de los inmuebles</li>
<li>Servicios para personas con discapacidad y espacios para educación especial</li>
<li>Espacios disponibles para el servicio educativo</li>
<li>Capacidad instalada</li>
<li>Protección civil</li>
<li>Mantenimiento y rehabilitación</li>
</ul>
<div id="ubicacion-de-todas-las-escuelas-censadas" class="section level3">
<h3>Ubicación de todas las escuelas censadas</h3>
<p>En este gráfico podemos ver la ubicación de todas las escuelas censadas y tienen color diferente dependiendo del nivel educativo al que se enfocan. En algunos casos no hay nivel educativo porque no es una escuela propiamente, pero sí un centro de trabajo, como puede ser una biblioteca.</p>
